import React from 'react'
import Comment from '../Comment/Comment'

export default function CommentsContainer({comments, addCommentCard}) {
  return (
    <div>
        {
            comments.map(el => <Comment key={el.id} {...el} {...{addCommentCard}}/>)
        }
    </div>
  )
}
